// AT starting
/*
import React from "react";
import { Link } from "react-router-dom";
function Home(){
    return(
        <>
            <h1>Home</h1>
            <p>This is our Home page</p>
            <Link to="/about">Go to About Page</Link> <br/>
        </>
    )
}
*/

// Navigation on Click
/*
import React from "react";
import { Link, useNavigate } from "react-router-dom";
function Home(){
    const navigate = useNavigate();
    return(
        <>
            <h1>Home</h1>
            <p>This is our Home page</p>
            <Link to="/about">Go to About Page</Link> <br/>
            <button onClick={()=> navigate('/about')}>Go to About page</button> <br/>
            <button onClick={()=> navigate('/filter')}>Go to Filter page</button>

        </>
    )
}
*/

// Navigation using function
import React from "react";
import { Link, useNavigate } from "react-router-dom";
function Home(){
    const navigate = useNavigate();
    function navigatePage(url){
        navigate()
    }
    return(
        <>
            <h1>Home</h1>
            <p>This is our Home page</p>
            <Link to="/about">Go to About Page</Link> <br/>
            <button onClick={()=> navigatePage('/about')}>Go to About page</button> <br/>
            <button onClick={()=> navigatePage('/filter')}>Go to Filter page</button>

        </>
    )
}

export default Home;
